import Footer from './Components/Footer';
import Header from './Components/Header';
import faker from 'faker'

function App() {
  return (
    <div>
      <Header /> 
      <body>
        <image src = {faker.image.avatar}/>
      </body>
      <Footer />
    </div>
  );
}

export default App;
